void Pubsub_choice_template::clean_up()
{
switch (template_selection) {
case SPECIFIC_VALUE:
switch (single_value.union_selection) {
case Pubsub_choice::ALT_affiliations:
delete single_value.field_affiliations;
break;
case Pubsub_choice::ALT_configure:
delete single_value.field_configure;
break;
case Pubsub_choice::ALT_default__:
delete single_value.field_default__;
break;
case Pubsub_choice::ALT_delete_:
delete single_value.field_delete_;
break;
case Pubsub_choice::ALT_purge:
delete single_value.field_purge;
break;
case Pubsub_choice::ALT_subscriptions:
delete single_value.field_subscriptions;
default:
break;
}
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
delete [] value_list.list_value;
default:
break;
}
template_selection = UNINITIALIZED_TEMPLATE;
}

