{
if (&other_value != this) {
clean_up();
copy_template(other_value);
}
return *this;
}

boolean Pubsub_choice_template::match(const Pubsub_choice& other_value) const
{
if (!other_value.is_bound()) return FALSE;
switch (template_selection) {
case ANY_VALUE:
case ANY_OR_OMIT:
return TRUE;
case OMIT_VALUE:
return FALSE;
case SPECIFIC_VALUE:
{
Pubsub_choice::union_selection_type value_selection = other_value.get_selection();
if (value_selection == Pubsub_choice::UNBOUND_VALUE) return FALSE;
if (value_selection != single_value.union_selection) return FALSE;
switch (value_selection) {
case Pubsub_choice::ALT_affiliations:
return single_value.field_affiliations->match(other_value.affiliations());
case Pubsub_choice::ALT_configure:
return single_value.field_configure->match(other_value.configure());
case Pubsub_choice::ALT_default__:
return single_value.field_default__->match(other_value.default__());
case Pubsub_choice::ALT_delete_:
return single_value.field_delete_->match(other_value.delete_());
case Pubsub_choice::ALT_purge:
return single_value.field_purge->match(other_value.purge());
case Pubsub_choice::ALT_subscriptions:
return single_value.field_subscriptions->match(other_value.subscriptions());
default:
TTCN_error("Internal error: Invalid selector in a specific value when matching a template of union type @http_jabber_org_protocol_pubsub_owner.Pubsub.choice.");
}
}
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
if (value_list.list_value[list_count].match(other_value)) return template_selection == VALUE_LIST;
return template_selection == COMPLEMENTED_LIST;
default:
TTCN_error ("Matching an uninitialized template of union type @http_jabber_org_protocol_pubsub_owner.Pubsub.choice.");
}
return FALSE;
}

