void Pubsub_choice_template::set_param(Module_Param& param)
{
  if (dynamic_cast<Module_Param_Name*>(param.get_id()) != NULL &&
      param.get_id()->next_name()) {
    char* param_field = param.get_id()->get_current_name();
    if (param_field[0] >= '0' && param_field[0] <= '9') {
      param.error("Unexpected array index in module parameter, expected a valid field"
        " name for union template type `@http_jabber_org_protocol_pubsub_owner.Pubsub.choice'");
    }
    if (strcmp("affiliations", param_field) == 0) {
      affiliations().set_param(param);
      return;
    } else if (strcmp("configure", param_field) == 0) {
      configure().set_param(param);
      return;
    } else if (strcmp("default_", param_field) == 0) {
      default__().set_param(param);
      return;
    } else if (strcmp("delete", param_field) == 0) {
      delete_().set_param(param);
      return;
    } else if (strcmp("purge", param_field) == 0) {
      purge().set_param(param);
      return;
    } else if (strcmp("subscriptions", param_field) == 0) {
      subscriptions().set_param(param);
      return;
    } else param.error("Field `%s' not found in union template type `@http_jabber_org_protocol_pubsub_owner.Pubsub.choice'", param_field);
  }
  param.basic_check(Module_Param::BC_TEMPLATE, "union template");
  switch (param.get_type()) {
  case Module_Param::MP_Omit:
    *this = OMIT_VALUE;
    break;
  case Module_Param::MP_Any:
    *this = ANY_VALUE;
    break;
  case Module_Param::MP_AnyOrNone:
    *this = ANY_OR_OMIT;
    break;
  case Module_Param::MP_List_Template:
  case Module_Param::MP_ComplementList_Template:
    set_type(param.get_type()==Module_Param::MP_List_Template ? VALUE_LIST : COMPLEMENTED_LIST, param.get_size());
    for (size_t p_i=0; p_i<param.get_size(); p_i++) {
      list_item(p_i).set_param(*param.get_elem(p_i));
    }
    break;
  case Module_Param::MP_Value_List:
    if (param.get_size()==0) break;
    param.type_error("union template", "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
    break;
  case Module_Param::MP_Assignment_List: {
    Module_Param* mp_last = param.get_elem(param.get_size()-1);
    if (!strcmp(mp_last->get_id()->get_name(), "affiliations")) {
      affiliations().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "configure")) {
      configure().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "default_")) {
      default__().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "delete")) {
      delete_().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "purge")) {
      purge().set_param(*mp_last);
      break;
    }
    if (!strcmp(mp_last->get_id()->get_name(), "subscriptions")) {
      subscriptions().set_param(*mp_last);
      break;
    }
    mp_last->error("Field %s does not exist in type @http_jabber_org_protocol_pubsub_owner.Pubsub.choice.", mp_last->get_id()->get_name());
  } break;
  default:
    param.type_error("union template", "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
  }
  is_ifpresent = param.get_ifpresent();
}

void Pubsub_choice_template::check_restriction(template_res t_res, const char* t_name) const
{
if (template_selection==UNINITIALIZED_TEMPLATE) return;
switch ((t_name&&(t_res==TR_VALUE))?TR_OMIT:t_res) {
case TR_OMIT:
if (template_selection==OMIT_VALUE) return;
case TR_VALUE:
if (template_selection!=SPECIFIC_VALUE || is_ifpresent) break;
switch (single_value.union_selection) {
case Pubsub_choice::ALT_affiliations:
single_value.field_affiliations->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
return;
case Pubsub_choice::ALT_configure:
single_value.field_configure->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
return;
case Pubsub_choice::ALT_default__:
single_value.field_default__->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
return;
case Pubsub_choice::ALT_delete_:
single_value.field_delete_->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
return;
case Pubsub_choice::ALT_purge:
single_value.field_purge->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
return;
case Pubsub_choice::ALT_subscriptions:
single_value.field_subscriptions->check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
return;
default:
TTCN_error("Internal error: Invalid selector in a specific value when performing check_restriction operation on a template of union type @http_jabber_org_protocol_pubsub_owner.Pubsub.choice.");
}
case TR_PRESENT:
if (!match_omit()) return;
break;
default:
return;
}
TTCN_error("Restriction `%s' on template of type %s violated.", get_res_name(t_res), t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Pubsub.choice");
}


