int Configure_template::size_of() const
{
  if (is_ifpresent) TTCN_error("Performing sizeof() operation on a template of type @http_jabber_org_protocol_pubsub_owner.Configure which has an ifpresent attribute.");
  switch (template_selection)
  {
  case SPECIFIC_VALUE:
  {    int ret_val = 0;
      if (single_value->field_node.is_present()) ret_val++;
      if (single_value->field_choice.is_present()) ret_val++;
      return ret_val;
    }
  case VALUE_LIST:
   {
     if (value_list.n_values<1)
       TTCN_error("Internal error: Performing sizeof() operation on a template of type @http_jabber_org_protocol_pubsub_owner.Configure containing an empty list.");
      int item_size = value_list.list_value[0].size_of();
      for (unsigned int l_idx = 1; l_idx < value_list.n_values; l_idx++)
      {
        if (value_list.list_value[l_idx].size_of()!=item_size)
          TTCN_error("Performing sizeof() operation on a template of type @http_jabber_org_protocol_pubsub_owner.Configure containing a value list with different sizes.");
      }
      return item_size;
    }
  case OMIT_VALUE:
    TTCN_error("Performing sizeof() operation on a template of type @http_jabber_org_protocol_pubsub_owner.Configure containing omit value.");
  case ANY_VALUE:
  case ANY_OR_OMIT:
    TTCN_error("Performing sizeof() operation on a template of type @http_jabber_org_protocol_pubsub_owner.Configure containing */? value.");
  case COMPLEMENTED_LIST:
    TTCN_error("Performing sizeof() operation on a template of type @http_jabber_org_protocol_pubsub_owner.Configure containing complemented list.");
  default:
    TTCN_error("Performing sizeof() operation on an uninitialized/unsupported template of type @http_jabber_org_protocol_pubsub_owner.Configure.");
  }
  return 0;
}

void Configure_template::log() const
{
switch (template_selection) {
case SPECIFIC_VALUE:
TTCN_Logger::log_event_str("{ node := ");
single_value->field_node.log();
TTCN_Logger::log_event_str(", choice := ");
single_value->field_choice.log();
TTCN_Logger::log_event_str(" }");
break;
case COMPLEMENTED_LIST:
TTCN_Logger::log_event_str("complement ");
case VALUE_LIST:
TTCN_Logger::log_char('(');
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++) {
if (list_count > 0) TTCN_Logger::log_event_str(", ");
value_list.list_value[list_count].log();
}
TTCN_Logger::log_char(')');
break;
default:
log_generic();
}
log_ifpresent();
}

void Configure_template::log_match(const Configure& match_value) const
{
if(TTCN_Logger::VERBOSITY_COMPACT == TTCN_Logger::get_matching_verbosity()){
if(match(match_value)){
TTCN_Logger::print_logmatch_buffer();
TTCN_Logger::log_event_str(" matched");
} else{
if (template_selection == SPECIFIC_VALUE) {
size_t previous_size = TTCN_Logger::get_logmatch_buffer_len();
if (match_value.node().ispresent()){
if(!single_value->field_node.match(match_value.node())){
TTCN_Logger::log_logmatch_info(".node");
single_value->field_node.log_match(match_value.node());
TTCN_Logger::set_logmatch_buffer_len(previous_size);
}
} else {
if (!single_value->field_node.match_omit()){
 TTCN_Logger::log_logmatch_info(".node := omit with ");
TTCN_Logger::print_logmatch_buffer();
single_value->field_node.log();
TTCN_Logger::log_event_str(" unmatched");
TTCN_Logger::set_logmatch_buffer_len(previous_size);
}
}
if (match_value.choice().ispresent()){
if(!single_value->field_choice.match(match_value.choice())){
TTCN_Logger::log_logmatch_info(".choice");
single_value->field_choice.log_match(match_value.choice());
TTCN_Logger::set_logmatch_buffer_len(previous_size);
}
} else {
if (!single_value->field_choice.match_omit()){
 TTCN_Logger::log_logmatch_info(".choice := omit with ");
TTCN_Logger::print_logmatch_buffer();
single_value->field_choice.log();
TTCN_Logger::log_event_str(" unmatched");
TTCN_Logger::set_logmatch_buffer_len(previous_size);
}
}
}else {
TTCN_Logger::print_logmatch_buffer();
match_value.log();
TTCN_Logger::log_event_str(" with ");
log();
TTCN_Logger::log_event_str(" unmatched");
}
}
return;
}
if (template_selection == SPECIFIC_VALUE) {
TTCN_Logger::log_event_str("{ node := ");
if (match_value.node().ispresent()) single_value->field_node.log_match(match_value.node());
else {
TTCN_Logger::log_event_str("omit with ");
single_value->field_node.log();
if (single_value->field_node.match_omit()) TTCN_Logger::log_event_str(" matched");
else TTCN_Logger::log_event_str(" unmatched");
}
TTCN_Logger::log_event_str(", choice := ");
if (match_value.choice().ispresent()) single_value->field_choice.log_match(match_value.choice());
else {
TTCN_Logger::log_event_str("omit with ");
single_value->field_choice.log();
if (single_value->field_choice.match_omit()) TTCN_Logger::log_event_str(" matched");
else TTCN_Logger::log_event_str(" unmatched");
}
TTCN_Logger::log_event_str(" }");
} else {
match_value.log();
TTCN_Logger::log_event_str(" with ");
log();
if (match(match_value)) TTCN_Logger::log_event_str(" matched");
else TTCN_Logger::log_event_str(" unmatched");
}
}

void Configure_template::encode_text(Text_Buf& text_buf) const
{
encode_text_base(text_buf);
switch (template_selection) {
case SPECIFIC_VALUE:
single_value->field_node.encode_text(text_buf);
single_value->field_choice.encode_text(text_buf);
case OMIT_VALUE:
case ANY_VALUE:
case ANY_OR_OMIT:
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
text_buf.push_int(value_list.n_values);
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
value_list.list_value[list_count].encode_text(text_buf);
break;
default:
TTCN_error("Text encoder: Encoding an uninitialized/unsupported template of type @http_jabber_org_protocol_pubsub_owner.Configure.");
}
}

void Configure_template::decode_text(Text_Buf& text_buf)
{
clean_up();
decode_text_base(text_buf);
switch (template_selection) {
case SPECIFIC_VALUE:
single_value = new single_value_struct;
single_value->field_node.decode_text(text_buf);
single_value->field_choice.decode_text(text_buf);
case OMIT_VALUE:
case ANY_VALUE:
case ANY_OR_OMIT:
break;
case VALUE_LIST:
case COMPLEMENTED_LIST:
value_list.n_values = text_buf.pull_int().get_val();
value_list.list_value = new Configure_template[value_list.n_values];
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
value_list.list_value[list_count].decode_text(text_buf);
break;
default:
TTCN_error("Text decoder: An unknown/unsupported selection was received in a template of type @http_jabber_org_protocol_pubsub_owner.Configure.");
}
}

void Configure_template::set_param(Module_Param& param)
{
  if (dynamic_cast<Module_Param_Name*>(param.get_id()) != NULL &&
      param.get_id()->next_name()) {
    char* param_field = param.get_id()->get_current_name();
    if (param_field[0] >= '0' && param_field[0] <= '9') {
      param.error("Unexpected array index in module parameter, expected a valid field"
        " name for record template type `@http_jabber_org_protocol_pubsub_owner.Configure'");
    }
    if (strcmp("node", param_field) == 0) {
      node().set_param(param);
      return;
    } else if (strcmp("choice", param_field) == 0) {
      choice().set_param(param);
      return;
    } else param.error("Field `%s' not found in record template type `@http_jabber_org_protocol_pubsub_owner.Configure'", param_field);
  }
  param.basic_check(Module_Param::BC_TEMPLATE, "record template");
  switch (param.get_type()) {
  case Module_Param::MP_Omit:
    *this = OMIT_VALUE;
    break;
  case Module_Param::MP_Any:
    *this = ANY_VALUE;
    break;
  case Module_Param::MP_AnyOrNone:
    *this = ANY_OR_OMIT;
    break;
  case Module_Param::MP_List_Template:
  case Module_Param::MP_ComplementList_Template:
    set_type(param.get_type()==Module_Param::MP_List_Template ? VALUE_LIST : COMPLEMENTED_LIST, param.get_size());
    for (size_t p_i=0; p_i<param.get_size(); p_i++) {
      list_item(p_i).set_param(*param.get_elem(p_i));
    }
    break;
  case Module_Param::MP_Value_List:
    if (2<param.get_size()) {
      param.error("record template of type @http_jabber_org_protocol_pubsub_owner.Configure has 2 fields but list value has %d fields", (int)param.get_size());
    }
    if (param.get_size()>0 && param.get_elem(0)->get_type()!=Module_Param::MP_NotUsed) node().set_param(*param.get_elem(0));
    if (param.get_size()>1 && param.get_elem(1)->get_type()!=Module_Param::MP_NotUsed) choice().set_param(*param.get_elem(1));
    break;
  case Module_Param::MP_Assignment_List: {
    Vector<bool> value_used(param.get_size());
    value_used.resize(param.get_size(), false);
    for (size_t val_idx=0; val_idx<param.get_size(); val_idx++) {
      Module_Param* const curr_param = param.get_elem(val_idx);
      if (!strcmp(curr_param->get_id()->get_name(), "node")) {
        if (curr_param->get_type()!=Module_Param::MP_NotUsed) {
          node().set_param(*curr_param);
        }
        value_used[val_idx]=true;
      }
    }
    for (size_t val_idx=0; val_idx<param.get_size(); val_idx++) {
      Module_Param* const curr_param = param.get_elem(val_idx);
      if (!strcmp(curr_param->get_id()->get_name(), "choice")) {
        if (curr_param->get_type()!=Module_Param::MP_NotUsed) {
          choice().set_param(*curr_param);
        }
        value_used[val_idx]=true;
      }
    }
    for (size_t val_idx=0; val_idx<param.get_size(); val_idx++) if (!value_used[val_idx]) {
      param.get_elem(val_idx)->error("Non existent field name in type @http_jabber_org_protocol_pubsub_owner.Configure: %s", param.get_elem(val_idx)->get_id()->get_name());
      break;
    }
  } break;
  default:
    param.type_error("record template", "@http_jabber_org_protocol_pubsub_owner.Configure");
  }
  is_ifpresent = param.get_ifpresent();
}

void Configure_template::check_restriction(template_res t_res, const char* t_name) const
{
if (template_selection==UNINITIALIZED_TEMPLATE) return;
switch ((t_name&&(t_res==TR_VALUE))?TR_OMIT:t_res) {
case TR_OMIT:
if (template_selection==OMIT_VALUE) return;
case TR_VALUE:
if (template_selection!=SPECIFIC_VALUE || is_ifpresent) break;
single_value->field_node.check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Configure");
single_value->field_choice.check_restriction(t_res, t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Configure");
return;
case TR_PRESENT:
if (!match_omit()) return;
break;
default:
return;
}
TTCN_error("Restriction `%s' on template of type %s violated.", get_res_name(t_res), t_name ? t_name : "@http_jabber_org_protocol_pubsub_owner.Configure");
}

boolean Configure_template::is_present() const
{
if (template_selection==UNINITIALIZED_TEMPLATE) return FALSE;
return !match_omit();
}

boolean Configure_template::match_omit() const
{
if (is_ifpresent) return TRUE;
switch (template_selection) {
case OMIT_VALUE:
case ANY_OR_OMIT:
return TRUE;
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int l_idx=0; l_idx<value_list.n_values; l_idx++)
if (value_list.list_value[l_idx].match_omit())
return template_selection==VALUE_LIST;
return template_selection==COMPLEMENTED_LIST;
default:
return FALSE;
}
return FALSE;
}

void Configure_choice::copy_value(const Configure_choice& other_value)
{
switch (other_value.union_selection) {
case ALT_x:
field_x = new jabber__x__data::X(*other_value.field_x);
break;
default:
TTCN_error("Assignment of an unbound union value of type @http_jabber_org_protocol_pubsub_owner.Configure.choice.");
}
union_selection = other_value.union_selection;
}

Configure_choice::Configure_choice()
{
union_selection = UNBOUND_VALUE;
}

Configure_choice::Configure_choice(const Configure_choice& other_value)
: Base_Type(){
copy_value(other_value);
}

Configure_choice::~Configure_choice()
{
clean_up();
}

Configure_choice& Configure_choice::operator=(const Configure_choice& other_value)
{
if (this != &other_value) {
clean_up();
copy_value(other_value);
}
return *this;
}

boolean Configure_choice::operator==(const Configure_choice& other_value) const
{
if (union_selection == UNBOUND_VALUE) TTCN_error("The left operand of comparison is an unbound value of union type @http_jabber_org_protocol_pubsub_owner.Configure.choice.");
if (other_value.union_selection == UNBOUND_VALUE) TTCN_error("The right operand of comparison is an unbound value of union type @http_jabber_org_protocol_pubsub_owner.Configure.choice.");
if (union_selection != other_value.union_selection) return FALSE;
switch (union_selection) {
case ALT_x:
return *field_x == *other_value.field_x;
default:
return FALSE;
}
}

jabber__x__data::X& Configure_choice::x()
{
if (union_selection != ALT_x) {
clean_up();
field_x = new jabber__x__data::X;
union_selection = ALT_x;
}
return *field_x;
}

const jabber__x__data::X& Configure_choice::x() const
{
if (union_selection != ALT_x) TTCN_error("Using non-selected field x in a value of union type @http_jabber_org_protocol_pubsub_owner.Configure.choice.");
return *field_x;
}

boolean Configure_choice::ischosen(union_selection_type checked_selection) const
{
if (checked_selection == UNBOUND_VALUE) TTCN_error("Internal error: Performing ischosen() operation on an invalid field of union type @http_jabber_org_protocol_pubsub_owner.Configure.choice.");
if (union_selection == UNBOUND_VALUE) TTCN_error("Performing ischosen() operation on an unbound value of union type @http_jabber_org_protocol_pubsub_owner.Configure.choice.");
return union_selection == checked_selection;
}

boolean Configure_choice::is_bound() const
{
  return union_selection != UNBOUND_VALUE;
}

boolean Configure_choice::is_value() const
{
switch (union_selection) {
case UNBOUND_VALUE: return FALSE;
case ALT_x: return field_x->is_value();
default: TTCN_error("Invalid selection in union is_bound");}
}

void Configure_choice::clean_up()
{
switch (union_selection) {
case ALT_x:
  delete field_x;
  break;
default:
  break;
}
union_selection = UNBOUND_VALUE;
}

void Configure_choice::log() const
{
switch (union_selection) {
case ALT_x:
TTCN_Logger::log_event_str("{ x := ");
field_x->log();
TTCN_Logger::log_event_str(" }");
break;
default:
TTCN_Logger::log_event_unbound();
}
}

void Configure_choice::set_param(Module_Param& param)
{
  if (dynamic_cast<Module_Param_Name*>(param.get_id()) != NULL &&
      param.get_id()->next_name()) {
    char* param_field = param.get_id()->get_current_name();
    if (param_field[0] >= '0' && param_field[0] <= '9') {
      param.error("Unexpected array index in module parameter, expected a valid field"
        " name for union type `@http_jabber_org_protocol_pubsub_owner.Configure.choice'");
    }
    if (strcmp("x", param_field) == 0) {
      x().set_param(param);
      return;
    } else param.error("Field `%s' not found in union type `@http_jabber_org_protocol_pubsub_owner.Configure.choice'", param_field);
  }
  param.basic_check(Module_Param::BC_VALUE, "union value");
  if (param.get_type()==Module_Param::MP_Value_List && param.get_size()==0) return;
  if (param.get_type()!=Module_Param::MP_Assignment_List) {
    param.error("union value with field name was expected");
  }
  Module_Param* mp_last = param.get_elem(param.get_size()-1);
  if (!strcmp(mp_last->get_id()->get_name(), "x")) {
    x().set_param(*mp_last);
    return;
  }
  mp_last->error("Field %s does not exist in type @http_jabber_org_protocol_pubsub_owner.Configure.choice.", mp_last->get_id()->get_name());
}

void Configure_choice::set_implicit_omit()
{
switch (union_selection) {
case ALT_x:
field_x->set_implicit_omit(); break;
default: break;
}
}

