boolean Subscriptions_template::match(const Subscriptions& other_value) const
{
if (!other_value.is_bound()) return FALSE;
switch (template_selection) {
case ANY_VALUE:
case ANY_OR_OMIT:
return TRUE;
case OMIT_VALUE:
return FALSE;
case SPECIFIC_VALUE:
if(!other_value.node().is_bound()) return FALSE;
if(!single_value->field_node.match(other_value.node()))return FALSE;
if(!other_value.subscription__list().is_bound()) return FALSE;
if(!single_value->field_subscription__list.match(other_value.subscription__list()))return FALSE;
return TRUE;
case VALUE_LIST:
case COMPLEMENTED_LIST:
for (unsigned int list_count = 0; list_count < value_list.n_values; list_count++)
if (value_list.list_value[list_count].match(other_value)) return template_selection == VALUE_LIST;
return template_selection == COMPLEMENTED_LIST;
default:
TTCN_error("Matching an uninitialized/unsupported template of type @http_jabber_org_protocol_pubsub_owner.Subscriptions.");
}
return FALSE;
}

